import { Link } from "react-router-dom";
import styled from "styled-components";

const Container = styled.div``;
function Nav() {
  return (
    <section id="navbar">
      <h1>Baseball Data</h1>
      <Link>How It Works</Link>
      <Link>About</Link>
    </section>
  );
}

export default Nav;
